import './ExpenseItems.css'

function ExpenseItems() {
    return (
        <div className='expense-item'>
            <div>March 28th 2022</div>
            <div>
                <h2 className='expense-item__description'>Car Insurance</h2>
                <div>300.00</div>
            </div>
        </div>
    )
}

export default ExpenseItems;
